import React, { Component } from 'react'
import Item from '../Item/Item'

export default class List extends Component {

    render() {
        const {todos} = this.props
        return (
            <ul>
                {
                    todos.map((todo) => {
                        return <Item key={todos.id}/>
                    })
                }
            </ul>
        )
    }
}
